description:
This is a 3rd person shooter set in an alternate history where the Soviet Union wins the Cold War and has invaded and occupied New York City. The player takes the role of Christopher Stone, a plumber-turned American Resistance movement leader fighting against the invaders.

Xpadder with a profile for the Xbox360 controller is included.

